<div class="de elHeadlineWrapper ui-droppable de-editable" id="tmp_headline1-30011-181" data-de-type="headline" data-de-editing="false" data-title="headline" data-ce="true" data-trigger="none" data-animate="fade" data-delay="500" style="margin-top: 0px; cursor: pointer; outline: none;" aria-disabled="false">
<div class="ne elHeadline lh3 elMargin0 elBGStyle0 hsTextShadow0 hsSize37" style="text-align: center; color: rgb(71, 71, 71);" data-bold="inherit" contenteditable="false"><b>The Money Isn't In the List... It's In The Products That You Sell To Your Email List</b></div>
</div>
<div class="de elHeadlineWrapper ui-droppable de-editable" id="headline-57271-189" data-de-type="headline" data-de-editing="false" data-title="headline" data-ce="true" data-trigger="none" data-animate="fade" data-delay="500" style="margin-top: 20px; cursor: pointer; outline: none;" aria-disabled="false">
<div class="ne elHeadline lh3 elMargin0 elBGStyle0 hsTextShadow0 hsSize18 de20pxPadding" style="text-align: left; background-color: rgba(232, 232, 232, 0.45098);" data-bold="inherit" contenteditable="false">
<b>First, there's no money in the list.</b> There is only money in the products that you promote, just like the retailer down the street. They are not being paid by simply being open and having customers walk in the door... No, no, no! It's ALL about the products they sell that make the money. <div><br></div>
<div>However, if this is the first time this person has paid you on Cash App, you'll have to manually accept the payment. </div>
